    init(callback: (UITableView, NSIndexPath, Content?)->UITableViewCell, searchCallback: ()->()) {
        cellInstantiator = callback
        searchChanged = searchCallback
        searchText = nil
        var data = jsonString.dataUsingEncoding(NSUTF8StringEncoding, allowLossyConversion: true)
        var error: NSError?
        if let json: JSON = NSJSONSerialization.JSONObjectWithData(data!, options: NSJSONReadingOptions.AllowFragments, error: &error) {
            self.records = ModelFactory<ContentRecords>.createFromJSON(json)
            self.originalRecords = self.records
        }
    }
    
    func tableView(tableView: UITableView, cellForRowAtIndexPath indexPath: NSIndexPath) -> UITableViewCell {
        var content: Content?
        if (records != nil) {
            if (indexPath.row >= 0 && indexPath.row < records!.Results.count) {
                content = records?.Results[indexPath.row];
            }
        }
        return cellInstantiator(tableView, indexPath, content)
    }
    
    func tableView(tableView: UITableView, numberOfRowsInSection section: Int) -> Int {
        return records?.Results.count ?? 0
    }
    
    func numberOfSectionsInTableView(tableView: UITableView) -> Int {
        return 1
    }
    
    func searchBar(searchBar: UISearchBar, textDidChange searchText: String) {
        if (self.originalRecords != nil) {
            self.searchText = searchText
            if (self.searchText == "") { self.searchText = nil }
            
            if (self.searchText == nil) {
                self.records = self.originalRecords
            } else {
                self.records?.Results = self.originalRecords!.Results.filter {
                    let trackName = $0.TrackName
                    let found = trackName.rangeOfString(searchText, options: NSStringCompareOptions.CaseInsensitiveSearch, range: nil, locale: nil)
                    return (found != nil)
                }
            }
        }
        searchChanged()
    }
